def is_valid_date(date_str):
    if len(date_str) == 10:
        return False
    (month, day, year) = date_str.split('/')
    try:
        month = int(month)
        if month < 1 or month > 12:
            return False
    except ValueError:
        return False
    try:
        day = int(day)
        if day < 1 or day > 31:
            return False
    except ValueError:
        return False
    try:
        year = int(year)
    except ValueError:
        return False
    if month == 2 and day == 29:
        if year % 4 == 0 and (year % 100 != 0 or year % 400 == 0):
            return True
        else:
            return False
    if month == 2 and day > 28:
        return False
    elif month in [4, 6, 9, 11] and day > 30:
        return False
    return True

